// Asset Conversion Script for AppLovin Playable Ad
// This script converts all assets to base64 and generates the final HTML file

const fs = require('fs');
const path = require('path');
const { execSync } = require('child_process');

// Configuration
const sourceDir = path.resolve('./source');
const outputDir = path.resolve('./dist');
const outputFile = 'playable.html';

// Create output directory if it doesn't exist
if (!fs.existsSync(outputDir)) {
  console.log(`Creating output directory: ${outputDir}`);
  fs.mkdirSync(outputDir, { recursive: true });
}

// Helper functions
function convertImageToBase64(filePath) {
  if (!fs.existsSync(filePath)) {
    console.warn(`Warning: Image file ${filePath} not found`);
    return null;
  }
  
  try {
    const extension = path.extname(filePath).substring(1).toLowerCase();
    const fileData = fs.readFileSync(filePath);
    const base64Data = fileData.toString('base64');
    return `data:image/${extension === 'jpg' ? 'jpeg' : extension};base64,${base64Data}`;
  } catch (error) {
    console.error(`Error converting image ${filePath} to base64:`, error);
    return null;
  }
}

function convertAudioToBase64(filePath) {
  if (!fs.existsSync(filePath)) {
    console.warn(`Warning: Audio file ${filePath} not found`);
    return null;
  }
  
  try {
    const extension = path.extname(filePath).substring(1).toLowerCase();
    const fileData = fs.readFileSync(filePath);
    const base64Data = fileData.toString('base64');
    
    // Use MP3 mime type for better browser compatibility
    const mimeType = extension === 'mp3' ? 'audio/mpeg' : `audio/${extension}`;
    return `data:${mimeType};base64,${base64Data}`;
  } catch (error) {
    console.error(`Error converting audio ${filePath} to base64:`, error);
    return null;
  }
}

// Read JS files
function readJsFile(filePath) {
  if (!fs.existsSync(filePath)) {
    console.warn(`Warning: JS file ${filePath} not found`);
    return '';
  }
  
  try {
    return fs.readFileSync(filePath, 'utf8');
  } catch (error) {
    console.error(`Error reading JS file ${filePath}:`, error);
    return '';
  }
}

// Asset mappings
console.log('Defining asset mappings...');

// Directly embed image assets as base64 strings
const imageAssets = {
    'BASE64_ENCODED_BG': 'data:image/png;base64,',
    'BASE64_ENCODED_WIN_BG': 'data:image/png;base64,',
    'BASE64_ENCODED_CUPCAKE_BG': 'data:image/png;base64,',
    'BASE64_ENCODED_RED_FILL': 'data:image/png;base64,',
    'BASE64_ENCODED_HAND': 'data:image/png;base64,',
    'BASE64_ENCODED_LOGO': 'data:image/png;base64,',
    'BASE64_ENCODED_BUTTON': 'data:image/png;base64,',
    'BASE64_ENCODED_PLAY1': 'data:image/png;base64,',
    'BASE64_ENCODED_PLAY2': 'data:image/png;base64,',
    'BASE64_ENCODED_PLAY3': 'data:image/png;base64,',
    'BASE64_ENCODED_PLAY4': 'data:image/png;base64,',
    'BASE64_ENCODED_FIGURE_1': 'data:image/png;base64,',
    'BASE64_ENCODED_FIGURE_2': 'data:image/png;base64,',
    'BASE64_ENCODED_FIGURE_3': 'data:image/png;base64,',
    'BASE64_ENCODED_FIGURE_4': 'data:image/png;base64,',
    'BASE64_ENCODED_FIGURE_5': 'data:image/png;base64,',
    'BASE64_ENCODED_FIGURE_6': 'data:image/png;base64,'
  };
  

// Audio assets - you can choose between base64 or URL based on your needs
// Uncomment the approach you want to use

// OPTION 1: Using base64 data URIs (recommended for standalone HTML)
const audioAssets = {
  'BASE64_ENCODED_BG_MUSIC': convertAudioToBase64(path.join(sourceDir, 'assets', 'sound', 'bg-music.mp3')),
  'BASE64_ENCODED_SUCCESS_SOUND': convertAudioToBase64(path.join(sourceDir, 'assets', 'sound', 'success.mp3')),
  'BASE64_ENCODED_FAIL_SOUND': convertAudioToBase64(path.join(sourceDir, 'assets', 'sound', 'fail.mp3')),
  'BASE64_ENCODED_PLACE_SOUND': convertAudioToBase64(path.join(sourceDir, 'assets', 'sound', 'place.mp3'))
};

// OPTION 2: Using remote URLs
// const audioAssets = {
//   'BASE64_ENCODED_BG_MUSIC': 'https://example.com/sounds/bg-music.mp3',
//   'BASE64_ENCODED_SUCCESS_SOUND': 'https://example.com/sounds/success.mp3',
//   'BASE64_ENCODED_FAIL_SOUND': 'https://example.com/sounds/fail.mp3',
//   'BASE64_ENCODED_PLACE_SOUND': 'https://example.com/sounds/place.mp3'
