//   'BASE64_ENCODED_FAIL_SOUND': './assets/sound/fail.mp3',
//   'BASE64_ENCODED_PLACE_SOUND': './assets/sound/place.mp3'
// };

// JS files for inlining
const jsFiles = {
  'AUDIO_MANAGER_JS': path.join(sourceDir, 'js', 'AudioManager.js'),
  'PUZZLE_PIECE_JS': path.join(sourceDir, 'js', 'PuzzlePiece.js'),
  'GAME_JS': path.join(sourceDir, 'js', 'Game.js')
};

// Generate HTML template
console.log('Generating HTML template...');
let htmlTemplate = `<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0, maximum-scale=1.0, user-scalable=no">
  <title>Cupcake Puzzle IQ Game</title>
  <style>
    body {
      margin: 0;
      padding: 0;
      overflow: hidden;
      background-color: black;
      font-family: Arial, sans-serif;
      -webkit-tap-highlight-color: transparent;
      touch-action: none;
    }
    #game-container {
      position: absolute;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
    }
    #loading {
      position: absolute;
      top: 50%;
      left: 50%;
      transform: translate(-50%, -50%);
      color: white;
      font-size: 24px;
      text-align: center;
    }
  </style>
  
  <!-- MRAID shim -->
  <script>
    if (typeof mraid === 'undefined') {
      window.mraid = {
        getState: function() { return 'ready'; },
        isViewable: function() { return true; },
        open: function(url) { window.open(url, '_blank'); },
        addEventListener: function(event, callback) {
          if (event === 'ready' && callback) {
            callback();
          }
        },
        removeEventListener: function() {},
        close: function() {},
        useCustomClose: function() {},
        expand: function() {}
      };
    }
  </script>
</head>
<body>
  <div id="loading">Loading 0%</div>
  <div id="game-container"></div>

  <!-- Libraries: PIXI.js, GSAP, and Howler (minified) -->
  <script src="https://cdnjs.cloudflare.com/ajax/libs/pixi.js/7.2.4/pixi.min.js"></script>
  <script src="https://cdnjs.cloudflare.com/ajax/libs/gsap/3.12.2/gsap.min.js"></script>
  <script src="https://cdnjs.cloudflare.com/ajax/libs/howler/2.2.4/howler.min.js"></script>
  
  <!-- Embedded game scripts -->
  <script>
    // AudioManager.js with improved audio handling
    AUDIO_MANAGER_JS

    // PuzzlePiece.js
    PUZZLE_PIECE_JS

    // Game.js
    GAME_JS

    document.addEventListener('DOMContentLoaded', function() {
      // Wait for MRAID to be ready (if available)
      function mraidIsReady() {
        return (typeof mraid !== 'undefined') && (mraid.getState() === 'ready');
      }
      
      function initGame() {
        const app = new PIXI.Application({
          width: 720,
          height: 1280,
          backgroundColor: 0x000000,
          resolution: window.devicePixelRatio || 1,
          antialias: true,
          autoDensity: true,
          powerPreference: 'default'
        });
        
        // insert canvas into container
        document.getElementById('game-container').appendChild(app.view);
        
        // enable zindex sorting
        app.stage.sortableChildren = true;
        
        // responsive resize handler
        const resize = () => {
          const scale = Math.min(
            window.innerWidth / app.screen.width,
            window.innerHeight / app.screen.height
          );
          
          // Set a maximum scale to prevent pixelation on larger screens
          const cappedScale = Math.min(scale, 2);
          
          app.view.style.position = 'absolute';
          app.view.style.width = Math.ceil(app.screen.width * cappedScale) + 'px';
          app.view.style.height = Math.ceil(app.screen.height * cappedScale) + 'px';
          app.view.style.left = '50%';
          app.view.style.top = '50%';
          app.view.style.transform = 'translate(-50%, -50%)';
        };
        
        window.addEventListener('resize', resize);
        window.addEventListener('orientationchange', resize);
        resize();
        
        // Image and audio assets 
        const assets = {
        // Images
          bg: PIXI.Texture.from("BASE64_ENCODED_BG"),
          win_bg: PIXI.Texture.from("BASE64_ENCODED_WIN_BG"),
          cupcakeBg: PIXI.Texture.from("BASE64_ENCODED_CUPCAKE_BG"),
          cupcakeRedFill: PIXI.Texture.from("BASE64_ENCODED_RED_FILL"),
          hand: PIXI.Texture.from("BASE64_ENCODED_HAND"),
          logo: PIXI.Texture.from("BASE64_ENCODED_LOGO"),
          button: PIXI.Texture.from("BASE64_ENCODED_BUTTON"),
          play1: PIXI.Texture.from("BASE64_ENCODED_PLAY1"),
          play2: PIXI.Texture.from("BASE64_ENCODED_PLAY2"),
          play3: PIXI.Texture.from("BASE64_ENCODED_PLAY3"),
          play4: PIXI.Texture.from("BASE64_ENCODED_PLAY4"),
          figure_1: PIXI.Texture.from("BASE64_ENCODED_FIGURE_1"),
          figure_2: PIXI.Texture.from("BASE64_ENCODED_FIGURE_2"),
          figure_3: PIXI.Texture.from("BASE64_ENCODED_FIGURE_3"),
          figure_4: PIXI.Texture.from("BASE64_ENCODED_FIGURE_4"),
          figure_5: PIXI.Texture.from("BASE64_ENCODED_FIGURE_5"),
          figure_6: PIXI.Texture.from("BASE64_ENCODED_FIGURE_6"),
          
          // Audios
          bgMusicUrl: 'BASE64_ENCODED_BG_MUSIC',
          successUrl: 'BASE64_ENCODED_SUCCESS_SOUND',
          failUrl: 'BASE64_ENCODED_FAIL_SOUND',
          placeUrl: 'BASE64_ENCODED_PLACE_SOUND'
        };
        
        // Hide loading screen
        document.getElementById('loading').style.display = 'none';
        
        // Detect if running on a low-end device
        const isLowEndDevice = window.navigator.hardwareConcurrency <= 2;
        if (isLowEndDevice) {
          app.ticker.maxFPS = 30; // Lower FPS for better performance
        }
        
        // Handle MRAID events for proper cleanup
        if (typeof mraid !== 'undefined') {
          mraid.addEventListener('viewableChange', function(isViewable) {
            if (!isViewable) {
              // Stop all sounds when ad is not viewable
              Howler.volume(0);
            }
          });
          
          mraid.addEventListener('stateChange', function(state) {
            if (state === 'hidden' || state === 'default') {
              // Stop all sounds when ad state changes
              Howler.volume(0);
            }
          });
        }
        
        // Create and initialize the game
        const game = new Game(app, assets);
        game.init();
        console.log('Game initialized successfully!');
        
        // For concole testing
        window.game = game;
        window.testSounds = function() {
          game.audio.playSuccessSound();
          setTimeout(() => game.audio.playFailSound(), 1000);
          setTimeout(() => game.audio.playPlaceSound(), 2000);
        };
      }
      
      // If MRAID is available, wait for it to be ready
      if (typeof mraid !== 'undefined') {
        if (mraidIsReady()) {
          initGame();
        } else {
          mraid.addEventListener('ready', initGame);
        }
      } else {
        // No MRAID, just init the game
        initGame();
      }
    });
  </script>
</body>
</html>`;

// Process images
console.log('Processing images...');
for (const [placeholder, base64Data] of Object.entries(imageAssets)) {
  if (base64Data) {
    htmlTemplate = htmlTemplate.replace(`"${placeholder}"`, `"${base64Data}"`);
    console.log(`  ✓ Processed ${placeholder}`);
  } else {
    console.warn(`  ⚠ Failed to process ${placeholder}`);
  }
}

// Process audio
console.log('Processing audio...');
for (const [placeholder, audioData] of Object.entries(audioAssets)) {
  if (audioData) {
    htmlTemplate = htmlTemplate.replace(`'${placeholder}'`, `'${audioData}'`);
    console.log(`  ✓ Processed ${placeholder}`);
    
    // If using relative paths, copy audio files
    if (audioData.startsWith('./')) {
      try {
        const sourceAudioPath = path.join(sourceDir, audioData.replace('./', ''));
        const destAudioPath = path.join(outputDir, audioData.replace('./', ''));
        
        // Create directory if it doesn't exist
        const destDir = path.dirname(destAudioPath);
        if (!fs.existsSync(destDir)) {
          fs.mkdirSync(destDir, { recursive: true });
        }
        
        // Copy the file
        if (fs.existsSync(sourceAudioPath)) {
          fs.copyFileSync(sourceAudioPath, destAudioPath);
          console.log(`  ✓ Copied audio file to ${destAudioPath}`);
        } else {
          console.warn(`  ⚠ Audio file not found at ${sourceAudioPath}`);
        }
      } catch (error) {
        console.error(`  ✗ Error copying audio file: ${error.message}`);
      }
    }
  } else {
    console.warn(`  ⚠ Failed to process ${placeholder}`);
  }
}

// Inline JS files
console.log('Inlining JavaScript files...');
for (const [placeholder, filePath] of Object.entries(jsFiles)) {
  const jsContent = readJsFile(filePath);
  if (jsContent) {
    htmlTemplate = htmlTemplate.replace(placeholder, jsContent);
    console.log(`  ✓ Inlined ${path.basename(filePath)}`);
  } else {
    console.error(`  ✗ Failed to inline ${path.basename(filePath)}`);
  }
}

// Write the output file
console.log(`Writing output file: ${path.join(outputDir, outputFile)}`);
fs.writeFileSync(path.join(outputDir, outputFile), htmlTemplate);

// Calculate file size
const stats = fs.statSync(path.join(outputDir, outputFile));
const fileSizeInBytes = stats.size;
const fileSizeInMegabytes = fileSizeInBytes / (1024 * 1024);

console.log(`\nConversion complete!`);
console.log(`Output file: ${path.join(outputDir, outputFile)}`);
console.log(`File size: ${fileSizeInMegabytes.toFixed(2)} MB`);

if (fileSizeInMegabytes > 5) {
  console.warn('\nWARNING: File size exceeds AppLovin\'s 5MB limit!');
  console.log('Consider reducing audio quality or image sizes to meet the 5MB limit.');
} else {
  console.log('\nFile size is within AppLovin\'s 5MB limit. Ready for submission!');
}

// Open the file in default browser
console.log('\nOpening in default browser for testing...');
try {
  const command = process.platform === 'win32' 
    ? `start "" "${path.join(outputDir, outputFile)}"`
    : `open "${path.join(outputDir, outputFile)}"`;
  execSync(command);
} catch (e) {
  console.log('Could not open file automatically. Please open manually for testing.');
}